    false,nt"url": null,nt"notes": "The Inspection Contractors (IC) listed
    have been accredited/licensed by the Maryland Department of the Environment to provide
    lead paint inspection services. The Inspection Contractors qualify to perform different
    types of inspections based on the accreditation category(ies) of the inspector(s)
    that work for the contractor. There are three kinds of lead paint inspectors. They
    qualify in the following ways:rnVisual Inspector (VI) - May perform Full or Modified
    Risk Reduction Inspections. This is done by a Dust Inspection or a Visual Inspection
    after unit has been prepared for inspection by an accredited lead paint abatement
    contractor. Visual Inspectors may also perform testing for Clearance.rnInspector
    Technician (IT) - May perform Lead Free Inspections. This is done by X-ray testing
    or paint chip analysis of all surfaces. Inspector Technicians may also perform testing
    for Clearance.rnRisk Assessor (RA) - May perform all the functions of a VI and IT.
    Risk Assessors may also perform Lead Hazard Screenings and Risk Assessments. Risk
    Assessors may identify lead hazards and make recommendations from analysis of X-ray
    testing, paint chips, dust, soil, water and questionnaires. Risk Assessors may also
    perform testing for Clearance.rnDisclaimer:rnFor your convenience MDE publishes
    this list of accredited lead contractors that meet Marylandu2019s standards to perform
    abatement activities involving lead-based paint. The list is an information resource
    only. MDE does not endorse any of the contractors included on this list nor does
    MDE provide any warranty about their performance. Consumers are advised to request
    bids and conduct reference checks before hiring. Contact the individual contractors
    for information regarding services and fees. Verify with the contractor you are
    going to hire that the inspector is accredited by MDE. This accreditation and training
    does not satisfy the EPA Renovation, Repair and Painting (RRP) Rule.rnIf you have
    questions regarding official inspection or abatement work procedures call MDE at
    410-537-3825.",nt"license_title": "License Not Specified",nt"extras":
